In TypeScript, you can use type assertions to tell the type system "I know that in theory this value may have multiple types, but in practice it will only have this one."

Type assertions are often used when you have a value that is inferred to have a certain type, but you know it's actually a specific type. For example, consider the following code:
```
const element = document.getElementById("my-element");
```
The inferred type of `element` is `HTMLElement | null`, because the `getElementById` method may return `null` if the element is not found. However, if you know that the element will always exist in your code, you can use a type assertion to tell the type system that `element` is of type `HTMLElement`.
```
const element: HTMLElement = document.getElementById("my-element");
```
In this case, TypeScript will treat `element` as an `HTMLElement`, even though it may have been inferred as `HTMLElement | null`.

It's important to be careful when using type assertions, as they can lead to type-related bugs if you're not sure that the asserted type is correct. Use type assertions judiciously and only when you are confident that they are necessary.

Another option is to use a type guard, which is a function that can be used to assert the type of a value. A type guard is a function that takes a value of one type and returns a boolean indicating whether the value is of a more specific type. Once the type guard is called, TypeScript will consider the value to be of the more specific type.

For example, you can use a type guard to assert that a value is of type `HTMLElement`, even though it may have been inferred as `HTMLElement | null`.
```
function isElement(element: HTMLElement | null): element is HTMLElement {
    return element!== null;
}
```

```
const element = document.getElementById("my-element");
if (isElement(element)) {
    // TypeScript will infer the type of "element" as "HTMLElement" within this block
    element.style.color = "red";
